import React from "react";
import styled from "styled-components";

const StyledDiv = styled.div`
  background-color: #ffffff;
  width: auto;
  height: 200px;
`;

const Footer = (props) => {
  return (
    <>
      <StyledDiv />
    </>
  );
};

export default Footer;
